const reactPolymerArray = splittedPolymer => {
  let result = splittedPolymer;
  let reacted = true;
  while (reacted) {
    reacted = false;
    const length = result.length;
    const savedIndices = [];
    result = result.filter((letter, index, array) => {
      if (index === length) return true;
      if (savedIndices.includes(index)) return false;
      let doesReact;
      if (letter === letter.toUpperCase()) {
        doesReact = letter.toLowerCase() === array[index + 1];
      } else {
        doesReact = letter.toUpperCase() === array[index + 1];
      }
      if (doesReact) savedIndices.push(index + 1);
      return !doesReact;
    });
    reacted = Boolean(savedIndices.length);
  }
  return result.join('');
};

export const reactPolymer = polymer => reactPolymerArray(polymer.split(''));

export const mostOptimalPolymer = polymer => {
  const splittedPolymer = polymer.split('');
  const length = splittedPolymer.length;
  const uniqueLowerLetters = splittedPolymer.reduce(
    (prev, curr) =>
      prev.includes(curr.toLowerCase()) ? prev : [...prev, curr.toLowerCase()],
    []
  );
  return uniqueLowerLetters.reduce((prev, lowerLetter) => {
    const currentLength = reactPolymerArray(
      splittedPolymer.filter(
        letter =>
          !(letter === lowerLetter || letter === lowerLetter.toUpperCase())
      )
    ).length;
    return currentLength < prev ? currentLength : prev;
  }, length);
};

